import * as React from 'react';
import { Button, TouchableOpacity } from 'react-native-web';
import { Header,Container,Title,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { View} from 'react-native';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';


function AddAlarmScreen({ navigation }) {
    return(
        <View>
            <Header>
                <HeaderButtonLeft>
                    <Ionicons name="chevron-back" size={20} color={"black"} />
                </HeaderButtonLeft>
                <HeaderButtonRight>
                    <Entypo name="dots-two-horizontal" size={20} color="black" />
                </HeaderButtonRight>
                <Title>Add Alarm</Title>
            </Header>
            <Container>
                <Button
                title="Add" 
                onPress={() => navigation.navigate()}
                />
                <Button
                title="Go to"
                onPress={() => navigation.navigate('AddAlarm')}
                />
                <TouchableOpacity>
                    style={{marinTop: 20, width:'70%', height: 50,alignItems: 'center', justifyContent:'center',}}
                    onPress={() => console.log("Button pressed")}
                    

                </TouchableOpacity>
            </Container>
        </View>
    );
}

export default AddAlarmScreen;
